import React from 'react';
import s from './Portfolio.module.css';
import Slider from 'react-slick';
import modelPhoto from '../../images/portfolio/modelPhoto.png';
import video from '../../images/portfolio/video.png';
import Pattern from '../../images/reviewsImage/Pattern.png';
import { NavLink } from 'react-router-dom';

const Portfolio = ()=>{

    const history = useHistory();

    const expandWindow =()=>{
        history.push('/craftframeShop/boxComposition')
    }
    let settings = {
        dots:false,
        infinite:false,
        slideToShow:1,
        slideToScroll:1,
        arrows:false,
        centerMode:true,
        centerPadding:'67px'
    };

    return(
<div className={s.portfolio}>
<Slider {...settings} className={s.portfolioSlider}>

<div>
    <img src={modelPhoto} ></img>
    <NavLink to='/portfolio/modelPhoto'> <p className={s.portfolioLink}>смотреть работы</p></NavLink>
</div>

<div>
    <img src={video} ></img>
    <NavLink to='/portfolio/video'> <p className={s.portfolioLink2}>смотреть работы</p></NavLink>
</div>

</Slider>
<div className={s.patternPortfolio}><img src={Pattern}/></div>
</div>
    );
};

export default Portfolio;
